import React from "react";
import "./App.css";
import InsertTodo from "./InsertTodo";
import Todos from "./components/Todos";
import TodosContainer from "./containers/TodosContainer";

function App() {
  return (
    <div className="Todo">
      <div className="Todo-Header">ToDo</div>
      <div className="Todo-Form">
        <TodosContainer />
      </div>
    </div>
  );
}

export default App;
